import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';



class Bars extends React.Component {
  render() {
    return (
      <div className="game">
        <div className="game-board">
        </div>
        <div className="game-info">
          Hello
        </div>
      </div>
    );
  }
}




ReactDOM.render(
    <Bars />,
  document.getElementById('root')
);
